package tamilhackstutorials;

public class NestedForLoop {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		// arrays
		// i= iterator
		for(int i=1;i<=6;i++) {  //i controls row
			for(int j=1;j<=5  ;++j){//j indicates column
		
		System.out.print(j);
	}
			System.out.print("\n");
}
	}
}



